Here is one way to refactor the code to make the S3 headObject call non-blocking using Fiber:

```php
use Fiber;
use GuzzleHttp\Promise\PromiseInterface;

protected function getMetaInfo($identifier): array|null 
{
  $this->normalizeIdentifier($identifier);

  if ($this->hasMetaInfoCacheEntry($identifier)) {
    return $this->getMetaInfoCacheEntry($identifier);
  }

  $promise = Fiber::suspend(function() use ($identifier) {
    return $this->s3Client->headObjectAsync([
      'Bucket' => $this->configuration['bucket'],
      'Key' => $this->applyIdentifierPrefix($identifier)
    ]);
  });

  if ($promise instanceof PromiseInterface) {
    $promise->wait();
  }

  $metadata = $promise->wait()->toArray();

  $metaInfoDownloadAdapter = GeneralUtility::makeInstance(MetaInfoDownloadAdapter::class);
  $metaInfo = $metaInfoDownloadAdapter->getMetaInfoFromResponse($this, $identifier, $metadata);

  $this->addMetaInfoCacheEntry($identifier, $metaInfo);

  return $metaInfo;
}
```

The key changes:

