Here's an implementation of depth first search in Python:
```
def depth_first_search(graph, start_node):
    visited = set()
    stack = []
    stack.append(start_node)
    while stack:
        current_node = stack.pop()
        if current_node in visited:
            continue
        visited.add(current_node)
        if current_node == end_node:
            return dfs_path(graph, current_node)
        for neighbor in graph[current_node]:
            if neighbor not in visited:
                stack.append(neighbor)
    return "No path found"
def dfs_path(graph, start_node):
    path = [start_node]
    while start_node!= end_node:
        current_node = graph[start_node][0]
        path.append(current_node)
        start_node = graph[current_node][1]
    return path
```
To use this function, you would pass in a dictionary `graph` where the keys are nodes and the values are lists of neighboring nodes. The `start_node` would be the initial node you want to start the search from. The `depth_first_search` function will return a string indicating whether a path was found and, if so, a list of nodes in the path. If no path was found, it will return "No path found". The `dfs_path` function takes in the `graph` and the `start_node` and returns a list of nodes in the path.

