In Swift, when you're initializing a struct or a class, you can't directly access its instance variables (also known as properties) within the initializer itself, because the initializer is executed before the `self` object is fully initialized.

Here's an example:

```swift
class Person {
    var firstName: String
    var lastName: String

    init(firstName: String) {
        \/\/ Cannot use firstName here because it hasn't been initialized yet
        self.firstName = firstName
        lastName = "Doe"
    }
}
```

In the above example, you're trying to access `firstName` inside the initializer, but since `self` is not yet fully initialized, Swift throws an error saying that you can't use instance members (such as `firstName`) within a property initializer.

To fix this, you can simply move the reference to `firstName` inside the initializer block, after the `self` object is initialized:

```swift
class Person {
    var firstName: String
    var lastName: String

    init(firstName: String, lastName: String = "Doe") {
        self.firstName = firstName
        self.lastName = lastName
    }
}
```

In this updated example, I've added a default value for the `lastName` property, and the initializer now takes both `firstName` and `lastName` as arguments. Within the initializer block, you can safely access both `firstName` and `lastName`, because they have been initialized by this point.

Alternatively, you can use a computed property to compute the value of a property based on other properties or variables. In this case, you can avoid accessing the property within the initializer altogether, as the computed property will be computed later.

Here's an example:

```swift
class Person {
    var firstName: String
    var lastName: String

    var fullName: String {
        return "\(firstName) \(lastName)"
    }

    init(firstName: String, lastName: String = "Doe") {
        self.firstName = firstName
        self.lastName = lastName
    }
}
```

In this updated example, I've added a computed property `fullName` that concatenates `firstName` and `lastName`. Since `fullName` is a computed property, you can safely access it within the initializer, because it will be computed later, after both `firstName` and `lastName` have been initialized.

I hope this helps clarify the issue and how to correct it!

