In d3, multiple listeners can be added to a selection by chaining the `` .on() `` method with a specific event type and a callback function. Here's an example of how to add multiple listeners to a rectangular selection:


```javascript
\/\/ create a rectangular selection
const rect = d3.select("#rect");

\/\/ add a listener for the "click" event
rect.on("click", () => {
  console.log("Rectangular selection was clicked");
});

\/\/ add a listener for the "mouseover" event
rect.on("mouseover", () => {
  console.log("Rectangular selection is being hovered over");
});

\/\/ add a listener for the "mouseout" event
rect.on("mouseout", () => {
  console.log("Rectangular selection is no longer being hovered over");
});

```

In this example, we created a `` rect `` selection using `` d3.select("#rect") ``, then added three listeners: one for the "click" event, one for the "mouseover" event, and one for the "mouseout" event.

When the rectangular selection is clicked, the "click" listener will be called and will log "Rectangular selection was clicked". When the rectangular selection is hovered over, the "mouseover" listener will be called and will log "Rectangular selection is being hovered over". When the rectangular selection is no longer being hovered over, the "mouseout" listener will be called and will log "Rectangular selection is no longer being hovered over".

Note that multiple listeners can also be added to the same selection using the `` .bind() `` method, but the `` .on() `` method makes it easier to manage and chain multiple listeners.

